import React, {Component} from 'react';

export default class AllHangouts extends Component {
    render(){
        return(
        <div>
            <h3>Hangouts</h3>
            <table className="table">
            <thead className="thead-light">
                <tr>
                    <th>Name</th>
                    <th>Location</th>
                    <th>Cost</th>
                </tr>
            </thead>
            </table>
        </div>)
    }
}
